(39, 'general-settings.at_a_glance', 'আমাদের কথা', '<p style=\"text-align: justify;\">দেশকে নিরক্ষরমুক্ত করার লক্ষ্যে সরকারের অঙ্গীকারের পঠভূমিতে দেশে সরকারি প্রাথমিক বিদ্যালয়ের পাশাপাশি স্থানীয় ও বেসরকারি উদ্যোগে প্রাথমিক বিদ্যালয় প্রতিষ্ঠা সময়ের দাবী। প্রাথমিক পর্যায়ে পরিপূর্ণ জ্ঞানের আলো শিশুদের মাঝে ছড়িয়ে দেয়ার লক্ষ্যে আমাদের ব্যাক্তিগত উদ্যোগে ও স্থানীয় গন্যমান্য ব্যক্তিবর্গের সহযোগীতায় ২০১১ সালের নভেম্বরে ডোরস বেসরকারি প্রাথমিক বিদ্যালয় প্রতিষ্ঠিত হয়। প্রতিষ্ঠাতা পরিচালক ও প্রধান শিক্ষক জনাব ইন্জিনিয়ার মোꓽ জাকির হোসেন এর আর্থিক বিনিয়োগ, পরিচালক জনাব মোꓽ রেজাউল হাসান এবং পরিচালক জনাব শংকর দে এর শিক্ষার প্রতি অনুরাগ ও ত্যাগ মহতী উদ্যোগের ভিত্তি রচিত হয়। উক্ত সময়ে বিদ্যালয় পরিচালনা পর্ষদ গঠন করে প্রধান শিক্ষক সহ মোট ৮ জন শিক্ষক নিয়োগ দেয়া হয়। ২০১২ শিক্ষাবর্ষ হতে পাঠদান কার্যক্রম চলমান। ২০১২ শিক্ষাবর্ষে প্রাক-প্রাথমিক শ্রেণি হতে চতুর্থ শ্রেণি পর্যন্ত মোট ৬৫ জন শিক্ষার্থী ভর্তির মাধ্যমে শিক্ষা কার্যক্রম শুরু হয়। দ্বীপ জেলা ভোলার বোরহানউদ্দিন উপজেলাধীন বোরহানগঞ্জ বাজারে অবস্থিত প্রতিষ্ঠানটি দীর্ঘ পথচলায় বিভিন্ন শ্রেণি পেশার অভিবাবকদের স্বপ্ন বাস্তবায়নের সুতিকাগার হিসাবে ভূমিকা পালন করছে ।</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">২০১৬ শিক্ষাবর্ষে বিদ্যালয়ের নাম পরিবর্তন করে ডোরস বিদ্যালয় নামে মাধ্যমিক পর্যায় শুরু করা হয়।২০১৬ সালে ষষ্ঠ শ্রেণিসহ মোট শিক্ষার্থী সংখ্যা ছিল ১২০ জন। ২০১৭ সালে সপ্তম শ্রেণি এভাবে পর্যায়ক্রমে ২০১৮ সালে অষ্টম শ্রেণি শুরু করে ১১জন শিক্ষার্থী ২০২১ সালের এস.এস.সি. পরীক্ষায় অংশগ্রহন করে। ৫ জন শিক্ষার্থী জিপিএ ৫ প্রাপ্ত হয়। ২০২৩ সালের বিদ্যালয় ভর্তি রেজিষ্টার অনুযায়ী প্রাক-প্রাথমিক শ্রেণি হতে ১০ম শ্রেণি পর্যন্ত মোট শিক্ষার্থী সংখ্যা প্রায় ৩০০। নিয়মিত শিক্ষক সংখ্যা ১৬ জন, গেস্ট শিক্ষক ৩ জন, অফিস সহকারি ১ জন এবং অফিস সহায়ক ১ জন।<strong>&nbsp;</strong></p>', NULL, 'rich_text_box', 19, 'General Settings'),
(40, 'general-settings.history', 'আমাদের ইতিহাস', '<p style=\"text-align: justify;\">দেশকে নিরক্ষরমুক্ত করার লক্ষ্যে সরকারের অঙ্গীকারের পঠভূমিতে দেশে সরকারি প্রাথমিক বিদ্যালয়ের পাশাপাশি স্থানীয় ও বেসরকারি উদ্যোগে প্রাথমিক বিদ্যালয় প্রতিষ্ঠা সময়ের দাবী। প্রাথমিক পর্যায়ে পরিপূর্ণ জ্ঞানের আলো শিশুদের মাঝে ছড়িয়ে দেয়ার লক্ষ্যে আমাদের ব্যাক্তিগত উদ্যোগে ও স্থানীয় গন্যমান্য ব্যক্তিবর্গের সহযোগীতায় ২০১১ সালের নভেম্বরে ডোরস বেসরকারি প্রাথমিক বিদ্যালয় প্রতিষ্ঠিত হয়। প্রতিষ্ঠাতা পরিচালক ও প্রধান শিক্ষক জনাব ইন্জিনিয়ার মোꓽ জাকির হোসেন এর আর্থিক বিনিয়োগ, পরিচালক জনাব মোꓽ রেজাউল হাসান এবং পরিচালক জনাব শংকর দে এর শিক্ষার প্রতি অনুরাগ ও ত্যাগ মহতী উদ্যোগের ভিত্তি রচিত হয়। উক্ত সময়ে বিদ্যালয় পরিচালনা পর্ষদ গঠন করে প্রধান শিক্ষক সহ মোট ৮ জন শিক্ষক নিয়োগ দেয়া হয়। ২০১২ শিক্ষাবর্ষ হতে পাঠদান কার্যক্রম চলমান। ২০১২ শিক্ষাবর্ষে প্রাক-প্রাথমিক শ্রেণি হতে চতুর্থ শ্রেণি পর্যন্ত মোট ৬৫ জন শিক্ষার্থী ভর্তির মাধ্যমে শিক্ষা কার্যক্রম শুরু হয়। দ্বীপ জেলা ভোলার বোরহানউদ্দিন উপজেলাধীন বোরহানগঞ্জ বাজারে অবস্থিত প্রতিষ্ঠানটি দীর্ঘ পথচলায় বিভিন্ন শ্রেণি পেশার অভিবাবকদের স্বপ্ন বাস্তবায়নের সুতিকাগার হিসাবে ভূমিকা পালন করছে ।</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">২০১৬ শিক্ষাবর্ষে বিদ্যালয়ের নাম পরিবর্তন করে ডোরস বিদ্যালয় নামে মাধ্যমিক পর্যায় শুরু করা হয়।২০১৬ সালে ষষ্ঠ শ্রেণিসহ মোট শিক্ষার্থী সংখ্যা ছিল ১২০ জন। ২০১৭ সালে সপ্তম শ্রেণি এভাবে পর্যায়ক্রমে ২০১৮ সালে অষ্টম শ্রেণি শুরু করে ১১জন শিক্ষার্থী ২০২১ সালের এস.এস.সি. পরীক্ষায় অংশগ্রহন করে। ৫ জন শিক্ষার্থী জিপিএ ৫ প্রাপ্ত হয়। ২০২৩ সালের বিদ্যালয় ভর্তি রেজিষ্টার অনুযায়ী প্রাক-প্রাথমিক শ্রেণি হতে ১০ম শ্রেণি পর্যন্ত মোট শিক্ষার্থী সংখ্যা প্রায় ৩০০। নিয়মিত শিক্ষক সংখ্যা ১৬ জন, গেস্ট শিক্ষক ৩ জন, অফিস সহকারি ১ জন এবং অফিস সহায়ক ১ জন।<strong>&nbsp;</strong></p>', NULL, 'rich_text_box', 20, 'General Settings'),
(41, 'general-settings.vision', 'আমাদের দর্শন', '<pre style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0); font-family: \'Nirmala UI\'; font-size: 9.8pt; text-align: left;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"background-color: rgb(247, 250, 255);\">উদ্যোগতাগণ ও শিক্ষকবৃন্দের ত্যাগী মানসিকতা তথা অর্থ উপার্জনের বাইরে শিক্ষা ও সামগ্রীক ক্ষেত্রে মানব উন্নয়নের প্রত্যয় আমাদের মূল শক্তি।<br></span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">Our motto is To acquire ultimate wisdom.<br></span><span style=\"background-color: rgb(247, 250, 255);\">যে জ্ঞান শুধুমাত্র পাঠ্যবই কিংবা ভাল ফলাফলের মধ্যে সিমাবদ্ধ থাকবেনা</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">, <br></span><span style=\"background-color: rgb(247, 250, 255);\">যে জ্ঞান সকল রহস্যের দরজা খুলে দেবে</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">, </span><span style=\"background-color: rgb(247, 250, 255);\">আমরা সেই জ্ঞানের সন্ধানে উম্মুখ</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">- </span><span style=\"background-color: rgb(247, 250, 255);\">যাহা মানুষকে সামগ্রীক মানবতায়</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">, </span><span style=\"background-color: rgb(247, 250, 255);\">সততায়</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">, </span><span style=\"background-color: rgb(247, 250, 255);\">ত্যাগে</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">, </span><span style=\"background-color: rgb(247, 250, 255);\">ভালবাসায় ও বুদ্ধিতে অনেক <br>উচ্চতায় নিয়ে যাবে। আমরা স্বপ্ন দেখি</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">-</span><span style=\"background-color: rgb(247, 250, 255);\">এই শিশুদেরকে উপযুক্ত পরিবেশ দেয়া হলে ও যথাযথ পরিচর্যা করলে এরাই একদিন এলাকার হাল ধরবে তথা দেশ ও জাতিকে করবে আলোকিত।<br></span><span style=\"background-color: rgb(247, 250, 255);\">সর্বপরি আমাদের  উদ্দেশ্য হলো শিক্ষার্থীদের মানসম্পন্ন শিক্ষা প্রদান করা। তাদেরকে সর্বোত্তম মানবিক গুনাবলীর অধিকারী করা</span><span style=\"background-color: rgb(247, 250, 255); font-family: \'Consolas\';\">, </span><span style=\"background-color: rgb(247, 250, 255);\">তাদের অধিকার ও দায়িত্ব সম্পর্কে সচেতন করা।</span></span></pre>', NULL, 'rich_text_box', 21, 'General Settings'),
(42, 'general-settings.facilities', 'আমাদের সুবিধাসমূহ', '<p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-scroll-snap-strictness: proximity; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / .5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; margin: 0px 0px 10px; color: rgb(36, 41, 47); font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Helvetica, Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\'; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">\"স্কুল সুবিধা\" বা \"স্কুল সামগ্রী\" বা \"স্কুল যন্ত্রসমূহ\" এমন পরিভাষার মাধ্যমে স্কুলের বিভিন্ন সুবিধা বা যন্ত্রসমূহের কিছু উদাহরণ নিচে দেওয়া হলো:</p>\r\n<ol style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-scroll-snap-strictness: proximity; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / .5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; margin: 0px 0px 16px; padding: 0px 0px 0px 2em; color: rgb(36, 41, 47); font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Helvetica, Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\'; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 4