(1, '0', '15', '1', 'আলহাজ্ব মো: নজরুল', 'ইসলাম', 'Md. Abul Hossain', 'Misses. Shirina Hossain', '1995-12-22', '2021-01-22', 1728748751, 1728748751, 'married', 'staff/November2023/oWZktUZll7WaLGfIkX08.png', 'fggggggggggggggggggggggggggggggggggggg', 'rrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrr', 'B.SC(HONOURS), M.SC IN ZOOLOGY', 'tttttttttttttttttttttttttttttttttttttttttt', '2011 সালে প্রতিষ্ঠিত একমাত্র উচ্চ শিক্ষা প্রতিষ্ঠান ডোরস বিদ্যালয়। এ প্রতিষ্ঠানে অধ্যয়নরত শিক্ষার্থীদের মেধা, মনন, সৃজনশীলতা, শৃঙ্খলা, অসাম্প্রদায়িক চেতনায় মানবিক মূল্যবোধ সম্পন্ন দেশপ্রেমিক নাগরিক গড়ে তোলায় এ প্রতিষ্ঠানের অংগীকার। শিক্ষার্থীদের শারিরীক ও মানসিক বিকাশের জন্য সাহিত্য, সাংস্কৃতিক, ক্রীড়া, রোভার স্কাউট ও রেড ক্রিসেন্টসহ নানামূখী কর্মসূচী এ কলেজে পালন করা হয়।তথ্য ও যোগাযোগ প্রযুক্তির যুগে বর্তমান বিশ্বের সাথে সংগতি রেখে আমাদের শিক্ষার্থীদের উচ্চ প্রযুক্তির যোগ্য নাগরিক হিসেবে গড়ে তোলার লক্ষ্যে তথ্য প্রযুক্তির উপর জোর দেয়া উচিত। এ লক্ষকে সামনে রেখেই এ কলেজের ছাত্র, শিক্ষক, অভিভাবক সকলেই কলেজের সকল তথ্য এবং কার্যক্রম সম্পর্কে জানতে পারে সেজন্যেই ডাইনামিক ওয়েবসাইট চালু করেছে। এতে সংশ্লিষ্ট সকলেই অতি সহজে প্রয়োজনীয় তথ্যে এক্সেস নিশ্চিত করতে পারবে এবং সামগ্রিক প্রশাসনে স্বচ্ছতা ও জবাবদিহিতা আনবে। এই ওয়েবসাইট খোলার ফলে এ কলেজের উন্নয়ন ও অগ্রগতির ইতিহাসে আরো একটি নতুন অধ্যায় যুক্ত হলো। আমি এই উপলক্ষে শিক্ষার্থী, শিক্ষক ও কর্মচারীদের কাছে শুভেচ্ছ জানাচ্ছি এবং এই প্রোগ্রামটির সফলতা কামনা করছি।', '2345', '50k', 'probation', 'Morning', 'iiiiiiiiiiiiuuuuuuuuuuuuuuuuuuuuuuuuuu', 2, 3, 3, 4, 5, '6', '3498796', 'Asia', '2324', 'dania', NULL, NULL, NULL, NULL, 'mdzakirhossen@gmail.com', '0', NULL, '$2y$10$r/ieLR3u4qjR1GjbOVZaQe/y2/.gvvoDlNfWhsla/toHxi0/XRe7m', '[{\"download_link\":\"staff\\\\December2022\\\\PKMVKtdus8lOoriEcwLG.xlsx\",\"original_name\":\"College Management System.xlsx\"}]', '[{\"download_link\":\"staff\\\\December2022\\\\3sZunGDnBC8WdcJqghGk.xlsx\",\"original_name\":\"College Management System.xlsx\"}]', '[{\"download_link\":\"staff\\\\December2022\\\\kiWxcXcjGs2FXXm6zagW.xlsx\",\"original_name\":\"College Management System.xlsx\"}]', '4', 321, '2022-11-10', 1, '2022-12-22 05:50:48', '2023-12-12 18:20:48', '2023-12-12 18:20:48', '9544', 'আলহাজ্ব মো: নজরুল ইসলাম', 222, 1),
(2, '01', '1', '18', 'ইঞ্জিনিয়ার জাকির', 'হোসেন', 'Late Md. Abdul Motaleb', 'Late Amena Begum', '1976-06-15', '1989-11-02', 1728748751, 1728748751, 'married', 'staff/August2023/XJk8njDJ8K9T9BLz5Oyi.png', 'বোরহানগঞ্জ, বোরহানউদ্দিন, ভোলা', 'বোরহানগঞ্জ, বোরহানউদ্দিন, ভোলা', '(এম.এস.সি ইঞ্জিনিয়ারিং), বি.আই.টি.বেইজিং,  চীন', 'As a lecturer from 02-11-89 to 31-05-1999, as a assistanr professor from 01-06-1999 to 05-09-2002, as a vice principal from 05-09-2002 to 07-02-2015, as a principal from 08-02-2015 to till now', 'শিক্ষা মানুষের অন্তরচোখ খুলে দেয়। আমরা মানুষ হিসাবে জন্মগ্রহন করলেও পারিবারিক, সামাজিক ও প্রাতিষ্ঠানিক শিক্ষা গ্রহন ব্যতিত বেড়ে উঠা গোটা মানব সভ্যতার ক্রমবর্ধমান বিকাশের পথে অন্তরায়। শিক্ষা অর্জনের মাধ্যমে মানুষ শিষ্টাচার শেখে এবং দায়িত্বশীল আচরণ করে। জীবনকে উপভোগ করতে চাইলে শিক্ষা অর্জনের বিকল্প নেই।  শিক্ষা আমাদের অন্তর্নিহীত শক্তিকে জাগ্রত করে ও অর্থনৈতিক মুক্তি দেয়। শিক্ষা হলো জীবনব্যাপী প্রক্রিয়া যেখানে একজন মানুষ জীবনের সূচনা হতে ক্রান্তি অবধি শিখতে থাকে। \r\n\r\nশিশুর শিক্ষার হাতেখড়ি পরিবার থেকে শুরু হয়। প্রাক-প্রাথমিক শ্রেণি হতে শিশুর প্রাতিষ্ঠানিক শিক্ষার শুরু। শিশুর সামাজিক বিকাশে প্রতিষ্ঠানের গুরুত্ব অপরিসীম। প্রাক-প্রাথমিক শিক্ষা  শিশুদের শারীরিক, মানসিক, বুদ্ধিভিত্তিক, ভাষাগত ও সামাজিক বিকাশের মজবুত ভিত্তি তৈরি করে। প্রাথমিক তথা প্রথম শ্রেণি হতে পঞ্চম শ্রেণি পর্য়ন্ত শিক্ষা গ্রহণের মাধ্যমে শিশুর শারীরিক, মানসিক, সামাজিক, নৈতিক, মানবিক, নান্দনিক,আধ্যাতিক ও আবেগিক বিকাশ সাধন হয়। যথাযথ শিক্ষা গ্রহনের মাধ্যমে শিশুরা দেশাত্মবোধে, বিজ্ঞানমনস্কতায়, সুজনশীলতায় ও উন্নত জীবনের স্বপ্ন দর্শনে  উদ্বুদ্ধ হয়। মাধ্যমিক পর্য়ায়ে বর্তমান শিক্ষাক্রম সাজানো হয়েছে দক্ষতা ভিত্তিক জনবল তৈরির মানসে। মাধ্যমিক শিক্ষার লক্ষ্য হলো, শিক্ষার্থীর সার্বিক বিকাশের মাধ্যমে মানবিক, সামাজিক ও নৈতিক গুনসম্পন্ন জ্ঞানী, দক্ষ,  যুক্তিবাদী, বিজ্ঞানমনস্ক ও সৃজনশীল দেশপ্রেমিক জনসম্পদ সৃষ্টি।    \r\n\r\nএকটি বিদ্যালয় প্রতিষ্ঠার স্বপ্ন বহু দিনের।  ১৯৯৬ সালের কথা, শাহাজালাল বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ে অনার্স প্রথম বর্ষ‌  পদার্থ  বিজ্ঞানের ছাত্র। আমার প্রাথমিক, মাধ্যমিক সম্পন্ন করেছি গ্রাম থেকে আর উচ্চ মাধ্যমিক জেলা সদরের সরকারি কলেজ থেকে। বিশ্ববিদ্যালয় জীবনের শুরুতেই মনে হয়েছে সরকারের বিবিধ কার্য়ক্রম সত্বেও  বাংলার গ্রামীণ জনপদে মানসম্মত প্রাথমিক  শিক্ষা প্রদানে ঘাটতি রয়েছে।বিশ্বাস ছিল, একটি এলাকায় শিক্ষার উৎকর্ষতা অর্জনের  জন্য প্রাথমিক শিক্ষার ভিত্তি মজবুত হওয়া বাঞ্চনীয়।  প্রাথমিক পর্য়ায়ে যদি শিশুরা যথাযথ শিক্ষার পরিবেশ থেকে বঞ্চিত হয় তথা অর্জন উপযোগী যোগ্যতা অর্জন না করে তবে মাঘ্যমিক পর‌্যায়ে তাদেরকে পড়াশুনায় মনযোগী করা প্রায় অসম্ভব। এই অনুধাবন থেকে নিজ এলাকা বরহানগঞ্জ বাজার কেন্দ্রিক আমার অত্যন্ত স্নেহভাজন মো: রেজাউল হাসান, শংকর চন্দ্র দে, অনুজ চন্দ্র দে এবং আবু জাফর নয়ন সহ আরও  সমমনা  কয়েকজন শিক্ষাণুরাগীর সমন্নয়ে  ২০১১ খ্রীষ্টাব্দে ডোরস  বেসরকারি  প্রাথমিক  বিদ্যালয় নামে  পাঠদান শুরু করি। \r\n\r\nআমাদের মূল লক্ষ্য হলো, পরিপূর্ণ জ্ঞান অর্জনে শিক্ষার্থীদের সর্বাত্বক সহযোগীতা করা। পরীক্ষায় ভাল ফলাফল নির্ভর শিক্ষায় আমরা বিশ্বাস করি না। আমরা মনে করি, জাতীয় শিক্ষাক্রমে সংযুক্ত বইগুলো অত্যন্ত মানসম্মত, পাঠ্যবইগুলো থেকে প্রাপ্ত জ্ঞান যুগোপযোগী এবং মানসম্মত।যে কোন ধরনের গাইড বইকে সম্পূর্ণ না।গাইড বইগুলো শিক্ষার্থীদের সৃজনশীলতা নষ্ট করে এবং শিক্ষার্থীরা  সমস্যার মুখোমুখি হয়ে সমস্যা সমাধানের চেষ্টা করার মতো সাহস অর্জনে পিছিয়ে থাকে। \r\n\r\nপ্রতিষ্ঠার প্রথম থেকেই যথেষ্ট সুনামের সহিত শিক্ষা কার‌্যক্রম চলমান। পরবর্তীতে ২০১৬  খ্রীষ্টব্দে ষষ্ঠ শ্রেণিতে শিক্ষার্থী ভর্তির মাধ্যমে মাধ্যমিক বিদ্যালয়ের কার‌্যক্রম শুরু হয়। বিদ্যালয়ের সার্বিক শিক্ষা কারিকুলামে ইংরেজি ভাষা এবং বিজ্ঞানের উপর বিশেষ নজর দেয়ার চেষ্টা করি। নবম শ্রেণিতে শুধুমাত্র বিজ্ঞান বিভাগে শিক্ষার্থী ভর্তি করি। ২০২১ খ্রীষ্টাব্দে প্রথম ব্যাচ এস.এস.সি. পরীক্ষায় অংশগ্রহণ করে। আলদহামদুলিল্লাহ, শিক্ষার্থীরা  খুব ভাল ফলাফল করে এবং পরবর্তি বছরগুলোতে ভাল ফলাফল অব্যহত আছে। \r\n\r\nআমাদের প্রচেষ্টা শিক্ষার্থীদের আত্মবিশ্বাসী হিসাবে গড়ে তোলা, যাতে ওরা স্পষ্টভাষী, সাহসী, বিনয়ী, সৎ, মননশীল এবং মানবিক মানুষ হিসাবে গড়ে উঠে।একটি প্রতিষ্ঠানকে মানুষ তৈরির ক্ষেত্র হিসাবে গড়ে তুলতে হলে দক্ষ শিক্ষক যেমন দরকার সেই সাথে প্রয়োজন দায়িত্বশীল অভিবাবক। আমাদের শিক্ষকদের দক্ষতা বৃদ্ধির পাশাপাশি অভিবাবকদের সচেতনতা কার‌্যক্রম চলমান ।শেষত, ডোরস বিদ্যালয়ের পরিচালনার দায়িত্বে যুক্ত  আমরা বিশ্বাস করি, প্রতিটি শিশুর মধ্যে অপার সম্ভাবনা রয়েছে।শিশুর শিক্ষার শুরুতে বা কোন পর‌্যায়ে এলোমেলো হলে বুঝতে হবে পারিবারিক. সামাজিক কিংবা প্রতিষ্ঠানের কারণে হচ্ছে। সমস্যা উদঘাটন করে সমাধানের চেষ্টা করতে হবে।প্রত্যেক শিক্ষার্থীর মধ্যে উদ্দিপনা সৃষ্টি করতে এবং শিক্ষাকে আনন্দদায়ক করে তাদের মনোজগদে স্বপ্নবুননের মাধ্যমে শিক্ষার্থীদের আত্মসম্মান সম্পন্ন মানুষ হিসাবে গড়ে তুলব ইনশাআল্লাহ।', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'mdzakirhossen@gmail.com', '0', NULL, NULL, '[]', '[]', '[]', '4', NULL, '1970-01-01', 1, '2023-03-01 05:29:19', '2023-12-12 22:38:08', NULL, '9544', 'ইঞ্জিনিয়ার জাকির হোসেন', NULL, 8),
(3, '02', '2', '13', 'মোঃ নিয়াজ', 'হোসেন', 'Sudhir Ranjan Nath', 'Geeta Rani Debi', '1966-10-11', '1993-05-16', 1757178259, 1757178259, 'married', 'staff/July2023/vWsRYVDyFGDoMqPpha4u.jpg', 'Amanat Homes, 95 Sadarghat Post Office Lane, Sadarghat, Chattogram-4000.', 'Amanat Homes, 95 Sadarghat Post Office Lane, Sadarghat, Chattogram-4000.', 'বি.এস.সি (গণিত)', '01. Lecturer in Accounting 9.5 years Experience.rn02. Assistant Professor in Accounting -17 yearsrn03. Vice Principal - Since 05/12/2019 till now.', 'বীর প্রসবিনী ভোলা জেলার বোরহানউদ্দিন উপজেলার স্বনামধন্য শিক্ষা প্রতিষ্ঠান ডোরস বিদ্যালয়। এ বিদ্যালয় একাডেমিক এবং প্রশাসনিক কার্যক্রমকে গতিশীল করার লক্ষ্যে তৈরী করা হয়েছে ডাইনামিক ওয়েবসাইট। তথ্য প্রযুক্তির এই যুগে শিক্ষার্থীদের আত্মবিকাশই আমাদের অংগীকার।শিক্ষার্থীদের শিক্ষাঙ্গন তথা ক্লাসমূখী করার জন্য নানাবিধ কর্মসূচী প্রচলন রয়েছে। এ সকল তথ্য সহজেই যাতে শিক্ষার্থীসহ সংশ্লিষ্ট সকলেই পেতে পারে সেই জন্যে তৈরী করা হয়েছে এই ডাইনামিক ওয়েবসাইট। বিদ্যালয় একাউন্টস, ভর্তি পদ্ধতি, পরীক্ষার ফলাফল সংরক্ষণ এবং শিক্ষার্থীদের অগ্রগতি প্রতিবেদন প্রস্তুত করা অনেক সহজ হবে। আমাদের সকলের সম্মিলিত প্রচেষ্টা ও অবদানে এই প্রতিষ্ঠানে ডাইনামিক ওয়েবসাই সংযুক্ত হয়ে এ বিদ্যালয় গৌরবদীপ্ত সাফল্যকে স্পর্শ করবে এটিই আমাদের অন্যতম প্রত্যাশা।', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'srnctg@gmail.com', '0', NULL, NULL, '[]', '[]', '[]', '4', NULL, '1970-01-01', 1, '2023-03-01 05:29:19', '2023-12-12 20:04:40', NULL, '9544', 'মোঃ নিয়াজ হোসেন', NULL, 8),
